__version__ = '0.0.1'

import os
import sys
import shutil
import subprocess as sp
import PyInstaller.__main__ as installer

from clera import *

def deploy():
    HAND_DRAWN_ICON = b''
    BACK_ICON = b''
    FOLDER_ICON = b''
    DEFAULT_SIZE = (246, 129)

    window = Window(fixed_size=DEFAULT_SIZE, style=fusion)
    progress_loading = ProgressBar(id='PROGRESS_LOADING', hidden=True)
    progress_done = ProgressBar(id='PROGRESS_DONE', max=100, value=100, hidden=True)

    # Titlebar('Deploy')
    windows_and_macos = {
        'icon': None,
        'state': '--windowed'
    }

    argv = {
        'name': '',
        'script': '',
        'output_path': '',
        'bundle_type': '--onefile',

        'windows': {
            'admin': None 
        },
    }

    platform = sys.platform
    # Check platform to enable os only features
    if platform == 'linux':
        disable = True
    else:
        disable = False

    # Set output folder path for final frozen application
    def set_output_folder(path):
        argv['output_path'] = path
        GET('OUTPUT').value(path)

    # Open dialog to select script file
    def select_file():
        filter  = '(Python: *.py)'
        path, extention = File().open(filter=filter, caption='Select File')

        if len(str(path)) != 0:
            argv['script'] = path
            GET('SCRIPT').value(path)

            set_output_folder(os.path.dirname(path))

    # Open dialog to select icon for application
    def select_icon():
        filter  = '(Icon: *.png, *.ico)'
        path, extention = File().open(filter=filter)

        if len(str(path)) != 0:
            windows_and_macos['icon'] = f'--icon={path}'
            GET('ICON').icon(path)

    # Open dialog to select output folder the final frozen applicaion
    def select_folder():
        path = Folder('Select Output Folder')
        if len(str(path)) != 0:
            set_output_folder(path)

    # complete loading widget
    def change():
        GET('PROGRESS_LOADING').hide()
        GET('PROGRESS_DONE').hidden(False)

    # Set widgets back to default
    def reset():
        GET('deploy').hidden(False)
        GET('PROGRESS_DONE').hide()

        done_button = GET('DONE')
        done_button.disable()
        done_button.hide()

        widgets_disable(False)

    # Diable/Enable widgets when processing/done
    def widgets_disable(status):
        GET('browse_one').disabled(status)
        GET('browse_two').disabled(status)
        GET('NAME').disabled(status)
        GET('TYPE').disabled(status)

        GET('SCRIPT').disabled(status)
        GET('OUTPUT').disabled(status)

        if platform != 'linux':
            GET('ICON').disabled(status)
            GET('UAC').disabled(status)

    # Initialize deployment process
    def init_deploy():
        if len(str(argv['output_path'])) != 0 or len(str(argv['script'])) != 0:
            GET('deploy').hide()
            GET('PROGRESS_LOADING').hidden(False)
            GET('DONE').hidden(False)
            # Diable all widgets
            widgets_disable(True)
            # Begin deployment
            thread(deploy_project)
        else:
            ...

    def deploy_project():
        name = str(GET('NAME'))
        output_path = argv["output_path"]
        
        if len(name.strip()) == 0:
            name = os.path.basename(argv['script']).removesuffix('.py')
            
        argv['name'] = f'--name={name}'

        
        # start application deployment process
        # sp.getoutput(f'pyinstaller {argv["name"]} {windows_and_macos["icon"]} {windows_and_macos["state"]} --distpath {output_path} {argv["bundle_type"]} {argv["script"]} --clean')
        distpath = f'--distpath={output_path}'
        scriptname = f'{argv["script"]}'
        log_level = '--log-level=ERROR'

        if GET('UAC').is_checked():
            argv['windows']['admin'] = '--uac-admin'

        command = [
            scriptname,
            argv["name"], 
            windows_and_macos["icon"],
            windows_and_macos["state"],
            argv["bundle_type"],
            argv['windows']['admin'],
            distpath,
            log_level
        ]

        while None in command:
            command.remove(None)

        # try:
        # AttributeError: module 'copy' has no attribute 'copy'
        installer.run(command)
        # except:
            # alternative method
        #   sp.getoutput(f'pyinstaller {scriptname} {argv["name"]} {windows_and_macos["icon"]} {windows_and_macos["state"]} {argv["bundle_type"]} {argv["windows"]["admin"]}')
        
        # Clean Cache and Temporary files
        # sp.getoutput(f'rm -r {output_path}/build')

        temp_path = os.curdir
        spec_file = f"{temp_path}/{name}.spec"
        try:
            shutil.rmtree(f'{temp_path}/build', True)
            os.remove(spec_file)
        except:
            ...

        # Insert "True" into hidden textarea to signal loading done
        GET('handler').value(True)
        GET('DONE').enable()

    type_options = [
        option('One File'),
        option('One Dir')
    ]

    state_options = [
        option('Windowed'),
        option('Console')
    ]


    # change file deployment type
    def change_option(id):
        selected = str(GET(id).current())
        
        if selected == 'One File':
            argv['bundle_type'] = '--onefile'
        else:
            argv['bundle_type'] = '--onedir'

        # if id.lower() == 'type':
            
        # else:
        #     if selected == 'Console':
        #         print('--console')
        #     else:
        #         print('--windowed')
        

    layout = [
        [
            Button(id='ICON', icon=HAND_DRAWN_ICON, func=select_icon, disabled=disable), 
            Input('Software Name', 'NAME'), 
            checkbox('UAC', disabled=disable, id='UAC')],
        [
            # Button(icon=HAND_DRAWN_ICON, sizepolicy=fixed),
            Input('Script', 'SCRIPT', readonly=True), 
            Button(icon=FOLDER_ICON, func=select_file, id='browse_one')
        ],
        [Input('Output Directory', 'OUTPUT', readonly=True), Button(icon=FOLDER_ICON, func=select_folder, id='browse_two')],
        # [Button(icon=HAND_DRAWN_ICON, sizepolicy=fixed), Select(state_options)],
        [
            # Button(icon=HAND_DRAWN_ICON, sizepolicy=fixed),
            Select(type_options, id='TYPE', current_text_changed=call(change_option, 'TYPE'), sizepolicy=fixed), 
            Button('DEPLOY', init_deploy, id='deploy'), 
            progress_loading,
            progress_done,
            textarea('handler',hidden=True, text_changed=change),
            Button(icon=BACK_ICON, func=reset, id='DONE', sizepolicy=fixed, disabled=True, hidden=True)
        ],
    ]

    Box(layout)
    window.run()